import React, { Component } from 'react'
import './Home.css'
class Home extends Component {
    render() {
        return (
            <div>
                <header className="App-header">
                    <h1>Sorting App</h1>
                    <p style={{ fontFamily: "courier" }}>helps u sort ur number !</p>
                </header>

            </div>

        );
    }
}

export default Home;
